tables.table_schema:
CREATE TABLE dataset_filters (
    filter_id INT PRIMARY KEY,
    filter_name VARCHAR(255),
    filter_criteria VARCHAR(255)
);

CREATE TABLE dataset_aggregates (
    aggregate_id INT PRIMARY KEY,
    aggregate_name VARCHAR(255),
    aggregation_type VARCHAR(255),
    aggregation_result DECIMAL(10,2)
);

CREATE TABLE dataset_filters (
    id UUID PRIMARY KEY,
    filter_name VARCHAR(255) NOT NULL,
    filter_query TEXT
);

CREATE TABLE dataset_aggregations (
    id UUID PRIMARY KEY,
    aggregation_name VARCHAR(255) NOT NULL,
    aggregation_query TEXT
);

CREATE TABLE dataset_insights (
    id UUID PRIMARY KEY,
    insight_name VARCHAR(255) NOT NULL,
    insight_description TEXT
);

CREATE TABLE dataset_results (
    id UUID PRIMARY KEY,
    insight_id UUID REFERENCES dataset_insights(id),
    result_value DECIMAL
);
